import React from "react";
import { useTheme } from "@emotion/react";
import { LoadingButton } from "@mui/lab";
import { Checkbox, Grid, TextField } from "@mui/material";
import { Box, styled } from "@mui/system";
import { Paragraph } from "app/components/Typography";
import { useFormik, FormikProvider, Form } from "formik";
import { useState } from "react";
import { NavLink, useNavigate, useParams } from "react-router-dom";
import * as Yup from "yup";
import {  _patch } from "../../apis/apiMethods";
import { useEffect } from "react";


//import { Toast } from "react-toastify/dist/components";

const FlexBox = styled(Box)(() => ({ display: "flex", alignItems: "center" }));

const JustifyBox = styled(FlexBox)(() => ({ justifyContent: "center" }));

const ContentBox = styled(JustifyBox)(() => ({
  height: "100%",
  padding: "32px",
  background: "rgba(0, 0, 0, 0.01)",
}));

export default function EditUser() {
  const theme = useTheme();
  const navigate = useNavigate();
  const [loading, setLoading] = useState(false);
  const [useid, setuseId] = useState();

  const { id } = useParams();

  const validationSchema = Yup.object().shape({
    full_name: Yup.string()
      .required("Name is required!"),
    user_name: Yup.string().required("Us er Name is required!"),
    contact_number: Yup.string().required("contact_number is required"),
    email: Yup.string()
      .email("Invalid Email address")
      .required("Email is required!"),
  });

  const initialValues = {
    full_name: "",
    user_name: "",
    email: "",
    contact_number: "",
    profile_image:""
  };

  useEffect(async () => {
    const user = await EditUser(id)
;
    //setUser(user.data);

    setFieldValue(`full_name`, user.data.full_name);
    setFieldValue(`user_name`, user.data.user_name);
    setFieldValue(`email`, user.data.email);
    setuseId(user.data._id)
    setFieldValue(`contact_number`, user.data.contact_number);
    setFieldValue(`profile_image`,user.data.profile_image);
    console.log(user, "users");
  }, []);

  const formik = useFormik({
    initialValues: initialValues,
    validationSchema: validationSchema,
    onSubmit: async (values) => {
      console.log("sdfsadf===", values)
      let postdata = {
        ...values,

      }

     await _patch (useid,values).then((res)=>{
      setuseId(res.data)
      console.log(res.data,"dta")
      navigate("/EditProfile");
    })
  },
  });

  const {
    values,
    errors,
    touched,
    handleSubmit,
    setFieldValue,
    getFieldProps,
  } = formik;


  /* const handleSubmit = async (id)
 => {
    const edit = await PatchUser(id)

    console.log(edit, "Editdata.........")
  }; */

  return (
    <div>
      <h1>edit users</h1>

      <Box width="100%" overflow="auto">
        <Grid item sm={6} xs={12}>
          <Box p={4} height="100%">
          <FormikProvider value={formik}>
          <Form onSubmit={handleSubmit}>
            <TextField
              fullWidth
              size="small"
              type="text"
              name="full_name"
              label="Username"
              variant="outlined"
              value={values.full_name}
              {...getFieldProps("full_name")}
              helperText={touched.full_name && errors.full_name}
              error={Boolean(errors.full_name && touched.full_name)}
              sx={{ mb: 3 }}
            />
            <TextField
              fullWidth
              size="small"
              type="text"
              name="user_name"
              label="User name"
              variant="outlined"
              {...getFieldProps("user_name")}
              value={values.user_name}
              helperText={touched.user_name && errors.user_name}
              error={Boolean(errors.user_name && touched.user_name)}
              sx={{ mb: 3 }}
            />

            <TextField
              fullWidth
              size="small"
              type="email"
              name="email"
              label="Email"
              variant="outlined"
              value={values.email}
              {...getFieldProps("email")}
              helperText={touched.email && errors.email}
              error={Boolean(errors.email && touched.email)}
              sx={{ mb: 3 }}
            />
            <TextField
              fullWidth
              size="small"
              name="contact_number"
              type="number"
              label="Contact number"
              variant="outlined"
              value={values.contact_number}
              {...getFieldProps("contact_number")}
              helperText={touched.contact_number && errors.contact_number}
              error={Boolean(errors.contact_number && touched.contact_number)}
              sx={{ mb: 2 }}
            />
             <TextField
              fullWidth
              size="small"
              name="profile_image"
              type="number"
              label="profile_image"
              variant="outlined"
              value={values.profile_image}
              {...getFieldProps("profile_image")}
              //onChange={(e) => setImage(e.target.files[0])}
              helperText={touched.profile_image&& errors.profile_image}
              error={Boolean(errors.profile_image && touched.profile_image)}
              sx={{ mb: 2 }}
            />
            <LoadingButton
              type="submit"
              color="primary"
              loading={loading}
              variant="contained"
              sx={{ mb: 2, mt: 3 }}
            >
              Regiser
            </LoadingButton>

            <Paragraph>
              Already have an account?
              <NavLink
                to="/session/signin"
                style={{ color: theme.palette.primary.main, marginLeft: 5 }}
              >
                Login
              </NavLink>
            </Paragraph>
          </Form>
          </FormikProvider>
          </Box>
        </Grid>
      </Box>
    </div>
  );
}
